import React from 'react'
import { useSelector, useDispatch } from "react-redux";
import { setIMGDATA } from '../redux/actions/IMGDATAaction';

function Game() {
    const { data } = useSelector((state) => state.data); 
    console.log(data)
    
  return (
    <div className='parent_body'>
      {data.map((imgs) => (
        <div className='parent' key={imgs.id}>
          <img src={imgs.src} alt={imgs.alt} />
        </div>
      ))}
    </div>
  )
}

export default Game
